import "../styles/home.css";

export default function HomeArticle({ articleKey, cover, title }) {
  return (
    <div className="pictureContainer">
      <img
        id={articleKey}
        src={cover}
        alt={title}
        width="400px"
        className="articlePicture"
      />
      <span className="articleText">
        <p>{title}</p>
      </span>
    </div>
  );
}
